import React, { Component } from "react";

class Weather extends Component {
  render() {
    return (
      <div>
        <h1>I am weather</h1>
      </div>
    );
  }
}
const mapStateToProps = state => ({
  weather: state
});

export default connect(mapStateToProps)(Weather);
